import React, { Component } from 'react'
import { Menu, Button } from 'antd';
import {
    AppstoreOutlined,
    MenuUnfoldOutlined,
    MenuFoldOutlined,
    PieChartOutlined,
    DesktopOutlined,
    ContainerOutlined,
    MailOutlined,
} from '@ant-design/icons';


const { SubMenu } = Menu;

export default class LeftNav extends Component {
    state = {
        collapsed: false,
      };
      toggleCollapsed = () => {
        this.setState({
          collapsed: !this.state.collapsed,
        });
      };
    
    render() {
        return (
            <div>
                我是左侧导航
            </div>
        )
    }
}
